deck_description:
This is a Numeron Eldlich deck I made recently. I actually got the idea to make it months ago, but I've been too lazy to post a deck profile. Anyways, this deck is named after Gold Experience Requiem, the most powerful Stand in JoJo's Bizzare Adventure: Vento Auero. So, between this and Golden Wind(<a rel="nofollow" href="https://ygoprodeck.com/golden-wind/">https://ygoprodeck.com/golden-wind/</a>), that's TWO Eldlich decks inspired by JoJo.

&nbsp;

Anyways, you'd prefer to go first with this deck, but 9 hand traps and some go-second cards in the Side Deck mean that it can still pack a whallop if you don't, especially given the battle-related effects of the Rank 1 "Numeron Gate" monsters. Nonetheless, you'd prefer to go first and try to summon Utopic ZEXAL so your opponent will never arrive at the truth.

&nbsp;

And before you ask...YES, that WAS a JoJo reference!

So you're saying... if I send a boy to the grave I can make Max boi?

&nbsp;

Ye.

&nbsp;

That's game.
